        <div>
            <label htmlFor="{species}">Filtro por especie</label>
            <ul>
                <li>
                    <label htmlfor={species}>
                        <input type="text" value={species} onChange={handleFilterBySpecies}>

                        </input>
                    </label>
                </li>

            </ul>
        </div>

    )
}
